import React, { useState, useEffect } from "react";
import "App.scss";
import { Router, Switch, Route, Link, Redirect } from "react-router-dom";
import { Login } from "components/display/Login";
import { Confirmation } from "components/display/ConfirmEmail";
import Saved from "components/display/SavedUsers";
import { Sidebar, Segment, Menu, Icon } from "semantic-ui-react";
import Landing from "components/display/Landing";
import { ErrorContext } from "core/store/ContextApi/Context";
import { createBrowserHistory } from "history";
import { ErrorHandler } from "modules/errorHandler";
import { AuthGuard, useStitchAuth } from "components/AuthGuard";
import { handleAuthRedirect } from "realm-web";
import Redirection from "components/display/Redirect";

export const history = createBrowserHistory();

function App() {
  const [visible, setVisibility] = useState(false);
  const [error, setError] = useState(false);
  let {
    isLoggedIn,
    currentUser,
    actions: { handleLogout },
  } = useStitchAuth();

  useEffect(() => {
    if (window.location.href.indexOf("baas_ua") !== -1) {
      handleAuthRedirect();
      console.log(currentUser);
    }
  });
  return (
    <Router history={history}>
      <ErrorContext.Provider value={{ error, setError }}>
        <ErrorHandler></ErrorHandler>
        <AuthGuard>
          <Sidebar.Pushable as={Segment}>
            <Sidebar
              onMouseLeave={() => setVisibility(false)}
              as={Menu}
              animation="overlay"
              icon="labeled"
              inverted
              onHide={() => setVisibility(false)}
              vertical
              visible={visible}
              width="thin"
            >
              <Link to="/">
                <Menu.Item as="div">
                  <Icon name="home" />
                  Home
                </Menu.Item>
              </Link>
              <Link to="/test-user">
                <Menu.Item as="div">
                  <Icon name="folder" />
                  Test - Saved
                </Menu.Item>
              </Link>
              <Link to="/stage-user">
                <Menu.Item as="div">
                  <Icon name="folder outline" />
                  Stage - Saved
                </Menu.Item>
              </Link>
              <Link to="/login">
                <Menu.Item
                  as="div"
                  onClick={() => {
                    if (isLoggedIn) handleLogout();
                  }}
                >
                  <Icon name={!isLoggedIn ? "sign-in" : "sign-out"} />
                  {!isLoggedIn ? "Log In" : "Log Out"}
                </Menu.Item>
              </Link>
            </Sidebar>
            <Sidebar.Pusher dimmed={visible}>
              <div className="App">
                <Switch>
                  <Route path="/login">
                    <Login />
                  </Route>

                  <Route path="/confirm">
                    <Confirmation />
                  </Route>
                  <Route path="/redirect" component={Redirection} />

                  {!isLoggedIn && <Redirect push to="/login" />}
                  <Route path="/test-user">
                    <Saved env="Test" />
                  </Route>
                  <Route path="/stage-user">
                    <Saved env="Stage" />
                  </Route>
                  <Route path="/">
                    <Landing />
                  </Route>
                </Switch>
              </div>
            </Sidebar.Pusher>
          </Sidebar.Pushable>
          <div
            style={{
              position: "absolute",
              left: "0",
              top: "0",
              width: "3%",
              height: "100%",
            }}
            onMouseEnter={() => setVisibility(true)}
          />
        </AuthGuard>
      </ErrorContext.Provider>
    </Router>
  );
}

export default App;
